import React from 'react'
import logo from './../images/logo.png'

const Navbar = () => {
  return (
    <div className='w-full h-14 bg-gray-300 px-8 '>
        <div className='flex flex-col'>
           <img className='w-6 h-6' src={logo} alt="Icon" />
        </div>
    </div>
  )
}

export default Navbar
